Thank you very much sir you explained very well and i am happy that i have implemented the algorithm in c++ by watching your <a href="http://video.here/">video.Here</a> is my implementation.<br><br>/////////////Starting from here//////////////////////////////////<br><a href="http://www.youtube.com/results?search_query=%23include">#include</a> &lt;iostream&gt;<br><a href="http://www.youtube.com/results?search_query=%23include">#include</a> &lt;string&gt;<br>using namespace std;<br><br>int frequency(int arr[], int s, int element)<br>{<br>    int count = 0;<br>    for (int i = 0; i &lt; s; i++)<br>    {<br>        if (arr[i] == element)<br>        {<br>            count++;<br>        }<br>    }<br>    return count;<br>}<br><br>int main()<br>{<br>    const int size = 7;<br>    int arr[size] = {3, 4, 8, 2, 3, 3, 2};<br>    cout &lt;&lt; &quot;The Given Array is : 
&quot;;<br>    for (size_t i = 0; i &lt; size; i++)<br>    {<br>        cout &lt;&lt; arr[i] &lt;&lt; &quot; &quot;;<br>    }<br>    cout &lt;&lt; &quot;

&quot;;<br><br>    // 1) Find the largest element in an array<br>    int largest = 0;<br>    for (int i = 0; i &lt; size; i++)<br>    {<br>        if (arr[i] &gt; largest)<br>        {<br>            largest = arr[i];<br>        }<br>    }<br>    cout &lt;&lt; &quot;First Step Complete Found The largest element is:&quot; &lt;&lt; largest &lt;&lt; endl;<br>    // 2) Create an temp array and initialize each element in array with 0<br>    const int TEMP_ARR_SIZE = ++largest;<br>    int *tempArray = new int(TEMP_ARR_SIZE);<br>    for (int i = 0; i &lt; TEMP_ARR_SIZE; i++)<br>    {<br>        tempArray[i] = 0;<br>    }<br>    cout &lt;&lt; &quot;Seocond Step Complete Created an temp array of size of largest element and initialized each element with 0
&quot;<br>         &lt;&lt; endl;<br>    // 3) Store the frequency of each element in array at that elements index in temp array<br>    for (int i = 0; i &lt; size; i++)<br>    {<br>        int frequency = 0;<br>        for (int j = 0; j &lt; size; j++)<br>        {<br>            if (arr[i] == arr[j])<br>            {<br>                frequency++;<br>            }<br>        }<br>        tempArray[arr[i]] = frequency;<br>        cout &lt;&lt; &quot;frequency of &quot; &lt;&lt; arr[i] &lt;&lt; &quot; is: &quot; &lt;&lt; frequency &lt;&lt; endl;<br>    }<br>    //Showing the temp array for satisfaction<br>    for (int i = 0; i &lt; TEMP_ARR_SIZE; i++)<br>    {<br>        cout &lt;&lt; &quot;
Temp array element of index &quot; &lt;&lt; i &lt;&lt; &quot; is : &quot; &lt;&lt; tempArray[i];<br>    }<br>    cout &lt;&lt; &quot;

Third Step Completed Created Stored the frequency of each elements in the array at that elements index in the temporary array.
&quot;<br>         &lt;&lt; endl;<br>    cout &lt;&lt; endl<br>         &lt;&lt; endl;<br>    // 4. Store the cumulative sum of the elements of the temporary array. It helps in placing the elements into the correct index of the sorted array.<br>    //Calculating camulative sum<br>    for (int i = 0; i &lt; TEMP_ARR_SIZE; i++)<br>    {<br>        if (i == 0)<br>        {<br>            tempArray[i] = tempArray[i];<br>        }<br>        else<br>        {<br>            tempArray[i] = tempArray[i] + tempArray[i - 1];<br>        }<br>        cout &lt;&lt; &quot;cumalative sum of element &quot; &lt;&lt; i &lt;&lt; &quot;: &quot; &lt;&lt; tempArray[i] &lt;&lt; endl;<br>    }<br>    cout &lt;&lt; &quot;

Fourth Step Completed Stored the cumalative sum of each element&#39;s in the array at that element‚Äôs index in the temporary array.
&quot;<br>         &lt;&lt; endl;<br>    // 5. Shifting Elements towards right now of temp array by one index<br>    int *newTempArray = new int(TEMP_ARR_SIZE);<br>    for (int i = 0; i &lt; TEMP_ARR_SIZE; i++)<br>    {<br>        if (i == 0)<br>        {<br>            newTempArray[i] = 0;<br>        }<br>        else<br>        {<br>            newTempArray[i] = tempArray[i - 1];<br>        }<br>        cout &lt;&lt; &quot;Sifted element towards right by one index at index: &quot; &lt;&lt; i &lt;&lt; &quot; elements are : &quot; &lt;&lt; newTempArray[i] &lt;&lt; endl;<br>    }<br>    cout &lt;&lt; &quot;
Shifted Elements towards right now of temp array by one index.
&quot;<br>         &lt;&lt; endl;<br>    // 6. Find the index of each element of the original array in the temporary array. This gives the cumulative count. Place the element at the index calculated as shown in the below image.<br>    bool check[size];<br>    for (int i = 0; i &lt; size; i++)<br>    {<br>        check[i] = 0;<br>    }<br><br>    int final_sorted_array[size];<br>    for (int i = 0; i &lt; size; i++)<br>    {<br>        const int element = arr[i];<br>        int frequencyOfCurrentArrayValue = frequency(arr, size, element);<br>        for (int j = 0; j &lt; TEMP_ARR_SIZE; j++)<br>        {<br>            if (arr[i] == j)<br>            {<br>                if (frequencyOfCurrentArrayValue &gt; 1)<br>                {<br>                    int tempIndexesToPlaceValue = newTempArray[j];<br>                    for (size_t k = 0; k &lt; frequencyOfCurrentArrayValue; k++)<br>                    {<br>                        final_sorted_array[tempIndexesToPlaceValue] = arr[i];<br>                        tempIndexesToPlaceValue++;<br>                    }<br>                }<br>                else<br>                {<br>                    final_sorted_array[newTempArray[j]] = arr[i];<br>                }<br>            }<br>        }<br>    }<br>    cout &lt;&lt; &quot;

The Final Sorted Array using Counting Sort is : 
&quot;;<br>    for (size_t i = 0; i &lt; size; i++)<br>    {<br>        cout &lt;&lt; &quot;  &quot; &lt;&lt; final_sorted_array[i] &lt;&lt; endl;<br>    }<br><br>    //freeing the memory<br>    delete[] tempArray;<br>}<br>//////////////////////////////////Here is my implementation/////////////////////////////////////////////////////<br><a href="https://github.com/Muhammad-Bilal-7896/Analysis-of-Algrithm/blob/master/Counting%20Sort%20Algorithm%20Implementation/program.cc">https://github.com/Muhammad-Bilal-7896/Analysis-of-Algrithm/blob/master/Counting%20Sort%20Algorithm%20Implementation/program.cc</a>
